import {Bar} from 'react-chartjs-2'
import { Link } from "react-router-dom";



export default function DrawGraph(data1) {
    console.log(data1)
    return (
        <div className='bar-chart'>
            <Bar
            data = {{
                labels:data1.members,
                datasets: [{
                    label: '# of votesk',
                    data: [1, 2, 3, 4],
                }

                ]
            }}
            height={400}
            width={600}
            />
            <Link to={'/TwitterTool'}>
                <span onClick={() => this.DrawGraph([1, 2, 3])}></span>
            <div className={`button`}><p style={{ paddingTop:'18px' }}>View data</p></div>
            </Link>
        </div>


        )
}



